pragma solidity ^0.4.24;

/**
 * @title OEM Factory
 * @dev Contract for deploying a device on chain
 */

import "../managed.sol";
import "../rolemanager.sol";
import "../registry.sol";
import "../device.sol";
import "../Tokens/DRMToken.sol";

contract OEM is managed{
    address public owner;
    bytes32 public ORG;

    struct device{
     address license;
     bytes32 deviceID;
     bytes32 oemSerial;
     bytes32 modelName;
     bytes32 deviceType;
     bytes32 deviceSku;
     }

    uint public deviceCount = 0 ;

    mapping(uint => device) public devices;


constructor(address _owner, bytes32 _ORG, address xManager,address xRegistryID) managed(xManager,xRegistryID) public {
  owner = _owner;
  ORG = _ORG;
  registryID = xRegistryID;
  manager = xManager;
}

function formatter(bytes32 _deviceID, bytes32 _modelName, bytes32 _deviceType) private returns(bool) {
    if (_deviceID == empty){emit Logger(logType.err , "missing deviceID", _deviceID, msg.sender); return false;}
    if (_modelName == empty) {emit Logger(logType.err , "missing model Name", _modelName, msg.sender); return false;}
    if (_deviceType == empty) {emit Logger(logType.err , "missing device Type", _deviceType, msg.sender); return false;}
    return true;
}

 function addDevice(bytes32 _deviceID, bytes32 _modelName, bytes32 _deviceType, bytes32 _deviceSku) public returns(bool success){

    if(formatter(_deviceID,_modelName, _deviceType)== true){

    //make sure the device is unique
      require(registry(registryID).device(_deviceID));

    //create a device contract
      Device genDevice = new Device(msg.sender, _deviceID, _modelName, _deviceType, _deviceSku, ORG);

    //store the data on new device
      device storage d = devices[deviceCount];
      d.deviceID = _deviceID;
      d.license = genDevice;
      d.modelName = _modelName;
      d.deviceType = _deviceType;
      d.deviceSku = _deviceSku;
      emit Logger(logType.statusUpdate, "Device Added", _deviceID, msg.sender);
      deviceCount++;
      return true;
    }
  }

 function multiDevice(bytes32[] _deviceID, bytes32[] _modelName, bytes32[] _deviceType, bytes32[] _deviceSku) public returns(bool success){

    for(uint i=0; i<_deviceID.length; i++){

     if(formatter(_deviceID[i],_modelName[i], _deviceType[i])== true){


    //make sure the device is unique
      require(registry(registryID).device(_deviceID[i]));

    //create a device contract
      Device genDevice = new Device(msg.sender, _deviceID[i], _modelName[i], _deviceType[i],_deviceSku[i], ORG);

    //store the data on new device
      device storage d = devices[deviceCount];
      d.deviceID = _deviceID[i];
      d.license = genDevice;
      d.modelName = _modelName[i];
      d.deviceType = _deviceType[i];
      d.deviceSku = _deviceSku[i];
      emit Logger(logType.statusUpdate, "Device Added", _deviceID[i], genDevice);
      deviceCount++;
     }
     //loop
    }
  return true;
 }
}
